pragma solidity >=0.4.22 <0.9.0;

import "./helpers.sol";
import "./ownable.sol";
import "./safemath.sol";

contract MagicRoom is Helpers, Ownable {
  using SafeMath for uint256;
  using SafeMath32 for uint32;
  using SafeMath16 for uint16;

  Room[] rooms;
  Tokenomics tokenomics = Tokenomics(1, 50, 28, 20);
  uint[] chairProbability = [13, 3, 3, 3, 13, 13, 13, 13, 13, 13];

  struct Tokenomics {
    uint fee;
    uint reward;
    uint vip;
    uint winners;
  }

  struct Room {
    uint price;
    uint bank;
    uint cycles;
    bool active;
    address[] chairs;
  }

  function createRoom(uint startPrice) external onlyOwner {
    uint activeRoomIndex = rooms.length.sub(1);
    require(!rooms[activeRoomIndex].active);
    uint cycles = getRandomRange(100, 2000);
    address[] memory chairs;
    rooms.push(Room(
      startPrice,
      0,
      cycles,
      true,
      chairs
    ));
  }

  function enterToRoom() external payable {
//    uint chairsIndex = getRandomIndexInArrayWitsProbability(chairProbability);
//    chairs[chairsIndex] = msg.sender;
  }
}
